import React from 'react'

export default function Die(props){
    const styles = {backgroundColor : '#59E391'}
    function Held(){
      return  !props.isHeld
    }
    return(
          <h2 onClick={Held} style={props.isHeld ? styles : ''}>{props.value}</h2>
    )
}
